    false,nt"url": null,nt"notes": "NCEI Accession 0145949 includes physical
    and underway data collected aboard the Sikuliaq during cruise SKQ201509T in the
    Bering Sea from 2015-07-15 to 2015-07-19. These data include CURRENT SPEED - EAST/WEST
    COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
    to collect these data include ADCP and GPS. These data were collected by University
    of Alaska - Fairbanks as part of Transit. The Lamont-Doherty Earth Observatory (LDEO)
    submitted these data to NCEI as part of the NSF sponsored Rolling Deck to Repository
    (R2R) program.nnThe ADCP data represent the raw and automated processed data set.
